pragma solidity ^0.4.23;

import "../node_modules/zeppelin-solidity/contracts/ownership/Ownable.sol";
import "../node_modules/zeppelin-solidity/contracts/token/ERC20/DetailedERC20.sol";

contract ERC721 {
    function tokensOfOwner(address owner)
        public
        view
        returns (uint256[] memory);
}

contract ERC20Wallet is Ownable {
    event WalletEvent(address addr, string action, uint256 amount);

    DetailedERC20 token;

    constructor(DetailedERC20 _token, address _owner) public {
        owner = _owner;
        token = _token;
    }

    function sweepWallet(
        DetailedERC20 _token,
        address _to,
        uint256 amount
    ) public {
        require(amount > 0);
        require(_token.balanceOf(this) >= amount);

        _token.transfer(_to, amount);
    }

    function swap(
        DetailedERC20 _tokenA,
        DetailedERC20 _tokenB,
        uint256 _amount
    ) public {
        require(_amount > 0);
        // require(_token.balanceOf(this) >= amount);
        _tokenA.transferFrom(msg.sender, address(this), _amount);
        _tokenB.transfer(msg.sender, _amount);
    }

    function swapTokens(
        DetailedERC20 _tokenA,
        DetailedERC20 _tokenB,
        address _from,
        address _to,
        uint256 _amount
    ) public {
        require(_amount > 0);
        // require(_token.balanceOf(this) >= amount);

        _tokenA.transferFrom(_from, _to, _amount);
        _tokenB.transferFrom(_to, _from, _amount);
    }

    function withdraw(address _to, uint256 amount) public returns (bool) {
        require(amount > 0);
        require(address(this).balance >= amount);

        _to.transfer(amount);
        return true;
    }

    function getBalance(address _addr) public constant returns (uint256) {
        return _addr.balance;
    }

    function tokenBalance(DetailedERC20 _tokenAddress)
        public
        view
        returns (uint256)
    {
        return _tokenAddress.balanceOf(this);
    }

    function() public payable {}
}
